import React from 'react';
import Card from './Card';

import Button from './Button';
import { v4 as uuidv4 } from 'uuid';





const blogs=[
    {
        id:uuidv4(),
        title:"An example blog",
        description:"A test description"
    },
    {
        id:uuidv4(),
        title:"An example blog 2",
        description:"A test description"
    },
    {
        id:uuidv4(),
        title:"An example blog 3",
        description:"A test description"
    },
    {
        id:uuidv4(),
        title:"An example blog 4",
        description:"A test description"
    },
];

console.log(uuidv4());
const blogData= blogs.map((blog)=>(
<Card key={blog.id}>
    <h1>{blog.title}</h1>
    <p>{blog.description}</p>

    {/*Pass event to the button*/}
    <Button 
    onClick={()=>{
        alert(`You visited  ${blog.title}.`);
    }}
    text="Visit Blog"
    color="Yellow"
        />

</Card>
));


export default function ListAndKeys(){
    return <div>{blogData}</div>
}
